import React from 'react';
import '../../styles/WineBar.css';
const WineBar = ({key, name, display_name, display_address, url}) => {
    return (
        <a href={url}>
        <div key={key} className="wineBarItem">
            <h1>{name}</h1>
            <p>{display_name}</p>
            <p>{display_address}</p>
        </div>
        </a>
    );
};

export default WineBar;
